import { Table } from 'antd';
const LeadersTable = () => {

const columns = [
  {
    title: 'מקום',
    dataIndex: 'place',
    sorter: (a, b) => a.place - b.place,
  },
  {
    title: 'בית ספר',
    dataIndex: 'school',
    sorter: (a, b) => a.age - b.age,
  },
  {
    title: 'כיתה',
    dataIndex: 'grade',
    sorter: (a, b) => a.age - b.age,
  },
  {
    title: 'תלמידים',
    dataIndex: 'howManyStudents',
    sorter: (a, b) => a.howManyStudents - b.howManyStudents,
  },
  {
    title: 'עיר',
    dataIndex: 'city',
    sorter: (a, b) => a.age - b.age,
  },
  {
    title: 'ציון ממוצע למטלה',
    dataIndex: 'avgGradePerAssignment',
    sorter: (a, b) => a.avgGradePerAssignment - b.avgGradePerAssignment,
  },
  {
    title: 'ציון ממוצע סופי',
    dataIndex: 'overallAvgGrade',
    sorter: (a, b) => a.overallAvgGrade - b.overallAvgGrade,
  },
];

const data = [
  {
    place: 1,
    school: 'John Brown',
    grade: "ו-2",
    city: "בת ים",
    howManyStudents: 23,
    avgGradePerAssignment : 95,
    overallAvgGrade : 90
  },
  {
    place: 2,
    school: 'John Brown',
    grade: "ו-2",
    city: "חיפה",
    howManyStudents: 43,
    avgGradePerAssignment : 65,
    overallAvgGrade : 50
  }
];

function onChange(pagination, filters, sorter, extra) {
  console.log('params', pagination, filters, sorter, extra);
}
  return (
    <div>
      <Table style={{width:"80%",margin:"auto"}} columns={columns} dataSource={data} onChange={onChange} />
    </div>
  );
};

export default LeadersTable;
